e = 65537
n = p * q

h1 = pow(2022 * p + 2021 * q, 1919, n)
h2 = pow(2021 * p + 2022 * q, 9191, n)

c = pow(m, e, n)
print("h1=", h1)
print("h2=", h2)
print("n=", n)
print("c=", c)
